import React from 'react';

class ToolBar extends React.Component {
    render() {
        return (
            <ul className='format-buttons m-0 px-2 d-flex flex-column align-items-center justify-content-center'>
                <button ><span class="bi bi-plus-circle"></span></button>
                <button><span class="bi bi-download"></span></button>
                <button><span class="bi bi-arrow-counterclockwise"></span></button>
                <button><span class="bi bi-arrow-clockwise"></span></button>
                <button><span class="bi bi-type-bold"></span></button>
                <button><span class="bi bi-type-italic"></span></button>
                <button><span class="bi bi-type-underline"></span></button>
                <button><span class="bi bi-text-left"></span></button>
                <button><span class="bi bi-text-center"></span></button>
                <button><span class="bi bi-text-right"></span></button>
                <button><span class="bi bi-list-ul"></span></button>
                <button><span class="bi bi-list-ol"></span></button>
            </ul>
        );
    }
}

export default ToolBar;
